import React from "react";
import Badge from "@material-ui/core/Badge";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import IconButton from "@material-ui/core/IconButton";

const useStyles = makeStyles(theme => appStyles(theme));

const ShoppingAppBar = props => {
  const classes = useStyles();

  const cartQuantityAddup = cartItems.reduce(
    (sum, item) => sum + item.quantity,
    0
  );

  return (
    <AppBar className={classes.appBar} position="static">
      <Toolbar>
        <Typography variant="h6" className={classes.title}>
          AegonLife Shopping
        </Typography>
        <IconButton
          aria-label="shows number of items added in cart"
          color="inherit">
          <Badge badgeContent={cartQuantityAddup} color="secondary">
            <img
              alt="shoppingCartImg"
              className={classes.image}
              src={require("assets/images/shoppingCart.png")}
            />
          </Badge>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default ShoppingAppBar;
